export async function addIcons(map) {
  if (map.hasImage("snowflake")) return;

  map.loadImage("https://img.icons8.com/emoji/48/snowflake.png", (err, image) => {
    if (err) throw err;
    if (!map.hasImage("snowflake")) map.addImage("snowflake", image);
  });

  map.loadImage("https://img.icons8.com/emoji/48/wind-face.png", (err, image) => {
    if (err) throw err;
    if (!map.hasImage("wind")) map.addImage("wind", image);
  });
}
